import React from 'react'

type buttonProps={
    width?:number;
    height?:number;
    rounded?:boolean;
    color?:string;
    text:string;
    onclick?:()=>void;
}

const Button = (
    {width = 90,
        height = 50,
        rounded = true,  
        color = 'black',
        text,
		onclick
	}:buttonProps)=>{
    return(<div>
        <button 
        style={{height:`${height}px`,
        width:`${width}px`,
       backgroundColor:color,
        color:'white', border:'none' , 
        borderRadius : `${rounded ? 5 : 0}px`,
        cursor:'pointer'}}
		onClick={onclick}>
            {text}
        </button>
    </div>)

}

export default Button;
